import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import Tick from "./Rendering"
import Welcome from './props';



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <div>
    <App/>
    <Tick />
    <Welcome/>
    </div>


);

